import classes from "./ChatUserInfoTopBar.module.css";

import userImage from '../../../../images/BibhuprasadMahakud.jpg'


const ChatUserInfoTopBar=()=>{




return(

<div className={classes.chatUserInfoTopBar}>

    <div className={classes.userImageDiv}>

       <img className={classes.userImage} src={userImage} alt='edr Logo' />


    </div>



  <TopUserChatTools/>




</div>	
);



}


export default ChatUserInfoTopBar;
